script: |
  super -f text -I q6445.spq | sort > q6445.out

inputs:
  - name: q6445.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT + + col1 IN ( - 23, ( - - col1 ) + - 57 / - 13, + 44, - 58 * CAST ( + col0 AS INTEGER ) / + col1 * - col2 );
  - name: tab2

outputs:
  - name: q6445.out
    data: |
      46	51	23
      64	77	40
      75	67	58
